import './App.css'
import { useState } from 'react'
import IceCream from "./components/ice-cream.tsx"
import Header from "./components/Header.tsx"
import Cart from "./components/cart.tsx"

function App() {
  const [counter,setcounter]=useState(0)
  const[price,setprice]=useState(0)

  const iceCremes=[
    {name:"Vanil",imgUrl:"data:image/jpeg;base64,",stok:10,price:10},
    {name:"Mango",imgUrl:"data:image/jpeg;base64,",stok:10,price:12},
    {name:"chocolate",imgUrl:"data:image/jpeg;base64,",stok:10,price:7},
    {name:"Pistachio",imgUrl:"data:image/jpeg;base64,",stok:10,price:9},
    {name:"strawberry",imgUrl:"data:image/jpeg;base64,",stok:10,price:10},
    {name:"Ferrero Rocher",imgUrl:"data:image/jpeg;base64,",stok:10,price:13}
  ]
  return (
    <>
    <Header logo="ice cream"/>

    <main>
      {iceCremes.map(ice=>(
        <IceCream name={ice.name} imgUrl={ice.imgUrl} stok={ice.stok} price={ice.price} setcounter={setcounter} setprice={setprice} />
      ))}
    </main>
    <footer>
      <Cart count={counter} price={price}/>
    </footer>
    </>
  )
}

export default App
